import './App.css';
import Card from './components/Card';
import MyBtn from './components/MyBtn';
import BoardInsertPage from './pages/board/BoardInsertPage';
import HomePage from './pages/HomePage';

function App() {
  const arr = ['하나', '둘', '셋'];
  // const temp = '안녕';
  // const temp = 789;
  // const temp = true; -구현안됨
  const temp = true;

  return (
    <>
      <h1>{temp}</h1>
      {arr.map((elem, idx) => {
        return <MyBtn x={elem} />;
      })}
    </>
  );
}
/*
  <Card a="♥" b="3" />
  <Card a="♣" b="5" />
  <Card a="♠" b="7" />
  <Card a="♦" b="9" />
  <MyBtn x="하나" />
  <MyBtn x="둘" />
  <MyBtn x="셋" />
*/
export default App;
